import React from 'react';
import PortfolioItem from './PortfolioItem';
import DigitalImg from '../imgs/digital.png';
import HandDoneGraphic from '../imgs/hand.png';
import Technica from '../imgs/technica-circle.png';
import VideoGraphic from '../imgs/play-pause.png';

const Portfolio = () => {
    return (
        <div>
            <section>
                <h2 className="title">Works I've done</h2>
            </section>

            <section className="padded">
                <div className="container ">
                    <div className="row wrap">
                        <PortfolioItem 
                            path="/graphic-design" 
                            image={DigitalImg} 
                            altText="Digital Graphic" 
                            color="green" 
                            name="Graphic Design" >
                        </PortfolioItem>

                        <PortfolioItem 
                            path="/hand-done" 
                            image={HandDoneGraphic} 
                            altText="Hand Done Graphic" 
                            color="brown" 
                            name="Hand Done" >
                        </PortfolioItem>

                        <PortfolioItem 
                            path="/technica" 
                            image={Technica} 
                            altText="Technica Logo" 
                            color="green" 
                            name="Technica" >
                        </PortfolioItem>

                    </div>
                </div>
            </section>
        </div>

    );
};

export default Portfolio;
